import React from 'react';
import PrivacyPolicy from '../components/PrivacyPolicy'; // Adjusted relative path to PrivacyPolicy component
import Subscription from '../components/Subscription'; // Adjusted relative path to Subscription component
import SocialMedia from '../components/SocialMedia'; // Adjusted relative path to SocialMedia component
import TermsOfService from '../components/TermsOfService'; // Adjusted relative path to TermsOfService component

const Footer = () => {
  return (
    <footer>
      <div className="footer-container">
        {/* Privacy Policy section */}
        <div className="footer-section">
          <PrivacyPolicy />
        </div>
        
        {/* Subscription section */}
        <div className="footer-section">
          <Subscription />
        </div>
        
        {/* Social Media section */}
        <div className="footer-section">
          <SocialMedia />
        </div>
        
        {/* Terms of Service section */}
        <div className="footer-section">
          <TermsOfService />
        </div>
      </div>
    </footer>
  );
}

export default Footer;
